export typescript definition for native import (#752)

you can use import * as alasql from "alasql" 
juste install with npm.

fix UPPER and LOWER

i kept getting TypeError: y.toUpperCase is not a function,

my temp fix is overwriting the function like so:
alasql.fn.UPPER = function(s) {
  return String(s).toUpperCase();
}

This should fix it at the source.
